import React from "react";

const Header = () => {
    return (
        <div style={{ backgroundColor: "#99E2EB", minHeight: "72px", boxShadow: "0px 0px 4px 0px", position: "sticky", top: "0" }}>
            <h1 style={{ color: "#001547", textShadow: "0px 2px 2px", textAlign: "center", padding: "17px", fontFamily: "fantasy", fontStyle: "italic" }}>
                Elite Hotel Management System
            </h1>
        </div>
    )
}

export default Header;
